import React from 'react';
import './styles.css';
const pikachuImageUrl = 'https://i.pinimg.com/originals/76/47/9d/76479dd91dc55c2768ddccfc30a4fbf5.png';

export default function Cart() {
  return (
    <div className='cart'>
      <h1>Carrinho</h1>
      <div className='item'>
      <div className='leftItems'>
        <img src={pikachuImageUrl} />
        <text className='name'>Pikachu</text>
        </div>
        <div className='rightItems'>
        <text className='price'>R$ 32</text>
        </div>
        </div>
      <div className='bottomContent'>
      <h2>Total : R$32</h2>
      </div>
    </div>
  );
};
